script: |
  super -f text -I q7399.spq | sort > q7399.out

inputs:
  - name: q7399.spq
    data: |
      SELECT - col1 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT 14 + + + col2 + col1 / + 15 / - + 88 NOT BETWEEN + + ( 71 ) AND NULL AND NOT NULL > col2 + col2;
  - name: tab0

outputs:
  - name: q7399.out
    data: |
